import React from 'react';

class Car extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            brand: "Ford",
            model: "Mustang",
            color: "red",
            year: 1964
        }
    }

    changeModel = () => {
        this.setState({model: 'Mercedes'});
    }

    render() {
        return (   
        <div>
             <h2>I'm a { this.state.model } </h2>
             <button type="button" onClick={this.changeModel}>Change Model</button>
        </div>     
        );   
    }
}

export default Car;
